import React from 'react'

class Todos extends React.Component{
    render(){
        const todos = this.props.tod.map((todo,i) => {
            return(
                <div className="card">
                    <div className="card-header">
                      {todo.title}
                    </div>

                    <div className="card-body">
                        {todo.description}

                    </div>

                </div>
            )
        })


        return(
            <div>
                    {todos}
            </div>

        )
    }
}


export default Todos;
